CREATE OR REPLACE FUNCTION add_dado_fundamentalista(
    dY_ DOUBLE PRECISION, evEbit DOUBLE PRECISION, evEbitda DOUBLE PRECISION, liquidezCorrente DOUBLE PRECISION,
    margeEbit DOUBLE PRECISION, margeLiq DOUBLE PRECISION, pAcl DOUBLE PRECISION, pAtivo DOUBLE PRECISION, pCapGiro DOUBLE PRECISION,
    pEbit DOUBLE PRECISION, pL_ DOUBLE PRECISION, pVp DOUBLE PRECISION, psr_ DOUBLE PRECISION, roe_ DOUBLE PRECISION,
    roic_ DOUBLE PRECISION, id_ativo BIGINT)

    RETURNS VOID AS
$$
DECLARE
    data DATE;
BEGIN

    data := now();

    INSERT INTO dados_fundamentalista(data_atualizacao, dy, ev_ebit, ev_ebitda, liquidez_corrente,
                                      marge_ebit, marge_liq, p_acl, p_ativo, p_cap_giro, p_ebit, pl, p_vp, psr, roe,
                                      roic, status, ativo_id)
    VALUES(data, dY_, evEbit, evEbitda, liquidezCorrente, margeEbit, margeLiq, pAcl, pAtivo, pCapGiro,
           pEbit, pL_, pVp, psr_, roe_, roic_, true, id_ativo);

END;
$$ LANGUAGE plpgsql;

